import './Home.css';
import { Parallax } from "react-parallax";
import Links from '../../components/Links/Links';
import '../../index.css';
import { scrollToSection } from '../../App.js'

// TODO: remove unused background pics
// const bkg_pic_light = require("./home-bkg-light.png");
// const bkg_pic_dark = require("./home-bkg-dark.png");
const bkg_pic_lehigh = require("./home-bkg-lehigh.jpg");
const my_headshot = require("./home-my-headshot.jpg");

function Home(props) {
  const handleLinkClick = (sectionId) => {
    console.log(`Clicked on ${sectionId} link`);
    scrollToSection(sectionId);
  };

  return (
    <div>
      <div className="Home-nav">
        <h1 className="Home-nav-title">RYAN SCHMID</h1>
        <div className="Home-nav-list">
          <div className='Home-nav-accent' />
          <div className="Home-nav-links">
            {/* TODO: write a method to move the page to the section and up by the height of the nav bar */}
            <p className='nav-link' onClick={() => handleLinkClick('Home')}>HOME</p>
            <p className='nav-link' onClick={() => scrollToSection('Experience')}>EXPERIENCE</p>
            <p className='nav-link' onClick={() => scrollToSection('Education')}>EDUCATION</p>
            <p className='nav-link' onClick={() => scrollToSection('Projects')}>PROJECTS</p>
            <p className='nav-link' onClick={() => scrollToSection('Contact')}>CONTACT</p>
          </div>
          <div className='Home-nav-accent' />
        </div>
      </div> 
      <Parallax
        // bgImage={props.theme === "light" ? bkg_pic_light : bkg_pic_dark}
        bgImage={bkg_pic_lehigh}
        bgImageAlt="Background image"
        strength={200}
      >
        <div className='Home-bkg'>
          <div className='Home-bkg-overlay'>
            <div className='Home-center'>
              <img className='Home-headshot' src={my_headshot} alt='Ryan Schmid'/>
              <div className='Home-center-text'>
                <p className="Home-welcome">
                  Welcome
                </p>
                <p className="Home-intro">
                  I'm Ryan, a recent Master's graduate of Lehigh University
                </p>
                <Links justify='left' />
              </div>
            </div>
          </div>
        </div>
      </Parallax>
    </div>
  );
}

export default Home;
